import React from "react";

class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        return (
            <form>
                <label htmlFor="search">Search</label>
                <input id="search" type="search" pattern=".*\S.*" required/>
                    <span className="caret"></span>
            </form>
        )
    }
}

export default Home;
